Com este aplicativo é possível monitorar as ações do(s) seu(s) veículo(s) 24 horas por dia, 365 dias por ano, de qualquer lugar.

Informações como localização em tempo real, velocidade, histórico percorrido, entre outras funções que proporciona maior segurança para o veículo e possibilita o gerenciamento da frota de forma rápida e eficaz.

Monitoramento de todos veículos em uma única tela;
Bloqueio e desbloqueio do veículo com apenas um clique;
Alertas de movimento não autorizado;
Alertas de excesso de velocidade;
Alertas de arrombamento;
Alertas de bateria fraca do rastreador;
Alertas de desconexão da bateria do veículo;
Alertas de ignição ligada ou desligada;
Informação de ignição ligada ou desligada;
Informação de velocidade do veículo em tempo real;
Informação do veículo em movimento ou parado.

